import Card from "../common/Card";

const PlayerList = ({ forwards, backs }) => {
  return (
    <div>
      <header>
        <h3>Forwards</h3>
      </header>
      {forwards.map((player) => {
        return <Card image="da"></Card>;
      })}

      <header>
        <h3>Backs</h3>
      </header>
    </div>
  );
};

export default PlayerList;
